import React from "react";
import Header from '../../widget/Components/Header.js'

function Home() {
  return (
    <div className="container-fluid">
      
      <Header/>
      
      <div className="hero">hero</div>
      <div className="footer">footer</div>
    </div>
  );
}

export default Home;
